var c = document.getElementById('c')
var v = document.getElementById('v')
var video = document.getElementById('video')
// video.pause()
var game;
var gameLoaded = false;
var createOnLoaded = false;
var this_ , hand_arr = [],answer_arr = [],num =0
window.onload = function () {
    c.style.visibility="hidden";
    var gameConfig = {
        type: Phaser.AUTO,
        parent:'c',
        width: 562,
        height: 1000,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],addFlag = false;
        
        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        this_= this
        video.play()
        this.bg = this.add.image(0,0,'bg1').setOrigin(0,0)    
        this.hand()
        

        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    update(){
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        console.log(video.currentTime.toFixed(1))
        this.showHand()
        if(video.currentTime.toFixed(1) == 7.0 && num == 0){
            c.style.visibility="visible";
            video.pause()
            setTimeout(() => {
                this.tattoo()
                setTimeout(() => {
                    this.hand.visible = 1
                }, 400);
            }, 500);
            num = 1
        }
        if( answer_arr[0] == 'tattoo') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
                this.bg.destroy()
                this.bg = this.add.image(0,0,'bg2').setOrigin(0,0)
            }, 500);
            answer_arr = []
        }

        if(video.currentTime.toFixed(1) == 10.0 && num == 1){
            c.style.visibility="visible";
            video.pause()
            setTimeout(() => {
                this.glasses()
            }, 500);
            num =2
        }

        if( answer_arr[0] == 'ses') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
                this.bg.destroy()
                this.bg = this.add.image(0,0,'bg3').setOrigin(0,0)

            }, 500);
            answer_arr = []
        }
        if(video.currentTime.toFixed(1) == 12.6 && num == 2 ){
            c.style.visibility="visible";
            video.pause()
            setTimeout(() => {
                this.hair()
            }, 500);
            num =3
        }
    }

    tattoo(){
        var letters = ['t','t','o','a','t','o']
        this.showWords(letters,{name:'words',x:281,y:650},'tattoo') 
        setTimeout(() => {
            this.hand.visible = 1 
        }, 300);
    }

            this.l = this.add.image(281-53,550,'a1').setDepth(2).setScale(0.8)
            this.l2 = this.add.image(281,550,'s1').setDepth(2).setScale(0.8)
        }, 300);
    }

                box_arr[i] = this.add.image(box[i].x,box[i].y,'box').setDepth(2).setScale(0.8,0.8)
            }
        }
    }

    showDownload() {
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics1 = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics1.alpha = 0.2;
        graphics1.setDepth(8);
        graphics1.fillRectShape(rect);
        var win_bg = this.add.image(281, -400, 'nice').setDepth(10)
        var down = this.add.image(281, 660, 'continue').setDepth(10).setScale(0, 0).setInteractive().on('pointerdown', () => {
            landingPage()
        })
        this.tweens.add({
            targets: [win_bg],
            y: 500,
            duration: 800,
            ease: 'Back',
            onComplete: () => {
                this.tweens.add({
                    targets: [down],
                    scaleX: 1,
                    scaleY: 1,
                    duration: 500,
                    onComplete: () => {
                    	// landingPage()
                        setInterval(() => {
                            this.tweens.add({
                                targets: [down],
                                scaleX: 1.1,
                                scaleY: 1.1,
                                duration: 300,
                                onComplete: () => {
                                    this.tweens.add({
                                        targets: [down],
                                        scaleX: 1,
                                        scaleY: 1,
                                        duration: 300,
                                        onComplete: () => {

                                        }
                                    })
                                }
                            })
                        }, 600);

                    }
                })
            }
        })
    }
    hand(){
    
        this.hand = this.add.image(-100,0,'hand').setDepth(10).setOrigin(0.3,0.1).setVisible(0)
        setInterval(() => {
            this.tweens.add({
                targets:[this.hand],
                scaleX:1,
                scaleY:1,
                duration:300,
                onComplete:()=>{
                    this.tweens.add({
                        targets:[this.hand],
                        scaleX:1.1,
                        scaleY:1.1,
                        duration:300,
                        onComplete:()=>{
                        }
                    })
                }
            })
        }, 600);
    }
    showHand(){
        var words_bg = {x:281,y:650}
        if(hand_arr.length == 0){
            this.hand.x = words_bg.x-80
            this.hand.y = words_bg.y+10
        }
        if(hand_arr[hand_arr.length-1] == 't' && hand_arr.length ==1){
            this.hand.x = words_bg.x-80
            this.hand.y = words_bg.y+90
        }
        if(hand_arr[hand_arr.length-1] == 'a'){
            this.hand.x = words_bg.x
            this.hand.y = words_bg.y+10
        }
        if(hand_arr[hand_arr.length-1] == 't' && hand_arr.length == 3){
            this.hand.x = words_bg.x
            this.hand.y = words_bg.y+90
        }
        if(hand_arr[hand_arr.length-1] == 't' && hand_arr.length == 4){
            this.hand.x = words_bg.x+80
            this.hand.y = words_bg.y+10
        }
        if(hand_arr[hand_arr.length-1] == 'o'){
            this.hand.x = words_bg.x+80
            this.hand.y = words_bg.y+90
        }

        
    }
    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
            v.style.width = windowWidth + "px";
            v.style.height = (windowWidth / gameRatio) + "px";
            c.style.width = windowWidth + "px";
            c.style.height = (windowWidth / gameRatio) + "px";
        }
        else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
            v.style.width = (windowHeight * gameRatio) + "px";
            v.style.height = windowHeight + "px";
            c.style.width = (windowHeight * gameRatio) + "px";
            c.style.height = windowHeight + "px";
        }
    }
}
